import React from 'react';
import ContentComponent from '../../components/ContentComponent';

function OpenRoleSetion() {
  return (
    <div style={{ backgroundColor: '#000', color: '#fff', height: 'auto', display: 'flex', paddingBottom: '20px'}}>
        <div style={{ width: '500px', height: '340px', backgroundColor: 'grey', marginLeft: '24px', float: 'left', padding: '20px', flex: '1' }}>
            Image goes here
        </div>
        <div style={{ width: '45%', marginLeft: '24px', float: 'left', padding: '20px', flex: '1' }}>
            <ContentComponent />
        </div>
    </div>
  )
}

export default OpenRoleSetion
